import * as React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Stack } from '@mui/material';
import { CardContent, CardMedia } from '@mui/material'
import Icon from '../../img/logo.svg'
import Card from '@mui/material/Card';
import { experimentalStyled as styled } from '@mui/material/styles';
import DirectionsRunIcon from '@mui/icons-material/DirectionsRun';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import AttachMoneyIcon from '@mui/icons-material/AttachMoney';
import { useNavigate, useLocation } from 'react-router-dom'

const Item = styled(Card)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: 'auto',
    maxWidth: 400,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

const Info: React.FC = () => {
    const { state } = useLocation();
    const navigate = useNavigate();
    const [value, setValue] = React.useState(state);
    const goUpdate = () => {
      navigate('/info_update')
    };
    const goDelete = () => {
      navigate('/info_delete')
    };

    return (
        <div className='info'>
            <Box sx={{ display: 'flex',position:'relative', width:550, height: 590, margin:'auto', textAlign:'center', border: 1, borderRadius: 5, backgroundColor:'#ffffff', flexDirection: 'column',mt:5, padding: 5 }} >
                <Stack  direction="row" spacing={2} alignItems="center" >
                <Item sx={{margin:'auto'}}>
                    <CardContent>
                        <CardMedia
                            component="img"
                            sx={{ width: 80 ,height:50}}
                            image={Icon}
                            alt="Paella dish"
                        />
                    </CardContent>
                </Item>
                </Stack>
                <br/>
                <Typography>회사명 : { state['companyName'] }</Typography>
                <br/>
                <Typography>홈페이지 : { state['companyUrl'] }</Typography>
                <br/>
                <Typography>기업정보 : { state['companyInfo'] }</Typography>
                <hr className='info_underline'/>
                <br/>
                <Stack direction={'row'} sx={{marginLeft:22}}>
                <Typography><AutoGraphIcon></AutoGraphIcon>매출</Typography>
                <Typography><AttachMoneyIcon></AttachMoneyIcon>연봉</Typography>
                <Typography><DirectionsRunIcon></DirectionsRunIcon>퇴사율</Typography>
                </Stack>
                <br/>
                <Typography>대표자명 : { state['companyCeo'] }</Typography>
                <br/>
                <Typography>기업주소 : { state['companyAdr'] }</Typography>
                <br/>
                <Typography>사업내용 : { state['companyContent'] }</Typography>
                <hr className='info_underline'/>
                <br/>
                <Item sx={{margin:'auto'}}>
                    <CardContent>
                        <CardMedia
                            component="img"
                            sx={{ width: 50 ,height:50}}
                            image={Icon}
                            alt="Paella dish"
                        />
                    </CardContent>
                </Item>
            </Box>
            <Stack direction="row" spacing={2} sx={{marginLeft:97,marginTop:2}}>
                    <Button variant="contained" sx={{ color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}} onClick={() => { goUpdate() }}>
                        수정
                    </Button>
                    <Button variant="outlined" sx={{color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}} onClick={() => { goDelete() }}>
                        삭제
                    </Button>
            </Stack>
        </div>
    );
}
export default Info;
